import styled from 'styled-components'

const Link = styled.a`
  color: ${props => props.corTexto || "palevioletred"};
  text-decoration: none;
  position: relative;
  &::after {
    content: '';
    width: 100%;
    height: 3px;

    display: block;
  }
`

export default Link
